-- some compatibility stuff
table.tostring=function(t)
	if type(t) == 'table' then
		local r
		for k,v in pairs(t) do
			if type(k) == 'string' then
				r = r..'["'..k..'"]='
			end
			if type(v) == 'table' then
				r = r..table.tostring(v)
			elseif type(v) == 'boolean' then
				r = r..tostring(v)
			else
				r = r..'"'..v..'"'
			end
			r = r..','
		end
		if r ~= '' then
				r = r:sub(1,r:len()-1)
		end
		return '{'..r..'}'
	else return t end
end
